import os

def save_team(team):
    filename = f'teams/{team["team_name"]}.txt'
    os.makedirs(os.path.dirname(filename), exist_ok=True)
    with open(filename, 'w') as f:
        for member in team['members']:
            f.write(member + "\n")

if __name__ == '__main__':
