import jinja2

def render_author_profile(first_name, last_name):
    env = jinja2.Environment(autoescape=False)
    template = env.from_string("Follow @{{ first_name[::-1] }}{{ last_name }}")

    return template.render(first_name=first_name, last_name=last_name)
